window.bookSummaryJSON = "<p><i>Big Hero 6</i> features brilliant robotics prodigy Hiro Hamada, who finds himself in the grips of a criminal plot that threatens to destroy the fast-paced, high-tech city of San Fransokyo. With the help of his closest companion - a robot named Baymax - Hiro joins forces with a reluctant team of first-time crime fighters on a mission to save their city. </p> <p><i>Big Hero 6 </i>retells the whole exciting story of the world's most awesome new team of Super Heroes! </p>"; 
